**Thanks for 1K Subscribers** 🔥
@onlyngoding

Sebagai bentuk perayaan atas pencapaian dari channel **OnlyCode**, kami ingin membagikan akses ke ratusan course premium dari Udemy melalui google Drive (bisa streaming dengan substitle/download). Namun, kami tidak membagikan linknya secara publik, kami berikan aksesnya lewat undangan email. Silahkan kontak kami melalui akun @onlycodeadmin dengan kode **UDEMY100** [TANPA KODE INI KALIAN TIDAK BISA MENDAPAT AKSES], terakhir tinggal tunggu balasan admin. 
Ingat, tidak dipungut biaya, nantinya setelah dibalas kalian akan diminta untuk mengirimkan alamat email akun google kalian untuk aksesnya,  hanya alamat email SAJA.

Sekali lagi, kami ucapkan terima kasih, kami harap semua resource yang kami bagikan dapat bermanfaat untuk teman-teman semua.

Note: chat kami untuk request aksesnya HANYA di t.me/onlycodeadmin

