#loker #Bandung #Jakarta
Rumah IT Bandung adalah perusahaan yang bergerak dibidang software development saat ini perusahaan kami membuka peluang untuk teman - teman bergabung dengan kami 

**1. Web : Php dengan framework Yii2/ Laravel/Angular/Node JS (4 Orang);
2. Mobile : Android Native/Kotlin, Flutter (1 Orang);

**- Minimal setingkat D3;
- Pengalaman minimal 5 tahun dalam Programming di bawah ini;
- Menguasai Repository tools (gitlab);
- Memahami Database Relational (Mysql, Postgree,Oracle) dan No Relasional (MongoDB).
- Menguasai programming menggunakan BPM (Bussines Process Model) (Camunda,process
maker);
- Menguasai Queue Tools (Rabbit MQ, dll)
- Menguasai back end (web service/micro service kon) dan front end programming (UI/UX) ;
- Minimal Pernah Menangani 5 project yang berbeda.
- Mampu bekerja dalam project yang sedang berjalan (ongoing project).
- **Onsite Di Bandung

kalo** tertarik silahkan masukkan cv dan portofolio lewat link https://bit.ly/RekrutmenRIT
Silahkan bagikan informasi ini ke teman atau saudara anda yang membutuhkan, semoga bisa bergabung menjadi  bagian dari kami.

